    [],nt"revision_timestamp": "2013-03-15T16:32:49.104770",nt"name": "national-assessment-of-oil-and-gas-project-southwestern-wyoming-province-037-quarter-mile-cell",nt"isopen":
    false,nt"url": null,nt"notes": "Cell maps for each oil and gas assessment
    unit were created by the USGS as a method for illustrating the degree of exploration,
    type of production, and distribution of production in an assessment unit or province.
    Each cell represents a quarter-mile square of the land surface, and the cells are
    coded to represent whether the wells included within the cell are predominantly
    oil-producing, gas-producing, both oil and gas-producing, dry, or the type of production
    of the wells located within the cell is unknown. The well information was initially
    retrieved from the IHS Energy Group, PI/Dwights PLUS Well Data on CD-ROM, which
    is a proprietary, commercial database containing information for most oil and gas
    wells in the U.S. Cells were developed as a graphic solution to overcome the problem
    of displaying proprietary PI/Dwights PLUS Well Data. No proprietary data are displayed
    or included in the cell maps. The data from PI/Dwights PLUS Well Data were current
    as of October 2001 when the cell maps were created in 2002.",nt"license_title":
